import { AfterViewInit, Component, Renderer2 } from '@angular/core';

declare var $: any; // Declaración de jQuery

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements AfterViewInit {

  constructor(private renderer: Renderer2) {}

  closeNavbar() {
    const navbarCollapse = document.getElementById('navbarCollapse');
    this.renderer.removeClass(navbarCollapse, 'show');
  }

  ngAfterViewInit() {
    this.initNavLinks();
    this.initScripts();
  }

  private initNavLinks() {
    const navLinks = document.querySelectorAll('.nav-item.nav-link');

    navLinks.forEach((link) => {
      link.addEventListener('click', () => {
        this.closeNavbar();
        this.showSpinner(); // Llama a la función para mostrar el spinner
      });
    });
  }

  private initScripts() {
    // Spinner
    const spinner = () => {
      setTimeout(() => {
        const spinnerElement = $('#spinner');
        if (spinnerElement.length > 0) {
          spinnerElement.removeClass('show');
        }
      }, 1);
    };

    spinner();
  }

  private showSpinner() {
    const spinnerElement = $('#spinner');
    if (spinnerElement.length > 1) {
      spinnerElement.addClass('show');
    }
  }
}
